import React from 'react';

function YourComponent() {
    return (
        <div>
            {[...Array(8).keys()].map(i => (
                <img src={`/icons/events&activities/e&a${i + 1}.jpg`} className="e" key={i} />
            ))}
        </div>
    );
}

export default YourComponent;
